    /**
     * Gets the attribute value for the calculated attribute TransAmount.
     * @return the TransAmount
     */
    public BigDecimal getTransAmount() {
        BigDecimal totAmount = null;
        Double rate =
            getUnitRate() != null ? getUnitRate().doubleValue() : 0.0;
        Double quantity =
            getQuantity() != null ? getQuantity().doubleValue() : 0.0;

        Double perct =
            "E".equals(getResourceTypeCode()) ? getSparesPercentage().doubleValue() +
            getMaintenancePercentage().doubleValue() :
            "M".equals(getResourceTypeCode()) ?
            getWastagePercentage().doubleValue() : 0.0;
        //        Double sparesPerct =
        //            getSparesPercentage() != null ? getSparesPercentage().doubleValue() :
        //            0.0;
        //        Double maintPerct =
        //            getMaintenancePercentage() != null ? getMaintenancePercentage().doubleValue() :
        //            0.0;
        //        Double watagePerct =
        //            getWastagePercentage() != null ? getWastagePercentage().doubleValue() :
        //            0.0;

        Double perctAmount = (rate * quantity) * (perct / 100);
        totAmount = new BigDecimal((rate * quantity) + (perctAmount));
        return totAmount;
    }

